open Sail_lib;;
module Big_int = Nat_big_num;;

let rec zeq_unit ((_, _) : (unit * unit)) : bool = sail_call (fun r -> true)

and zneq_atom ((zx, zy) : (Big_int.num * Big_int.num)) : bool = sail_call (fun r ->
  not (eq_int (zx, zy)))

and zneq_range ((zx, zy) : (Big_int.num * Big_int.num)) : bool = sail_call (fun r ->
  not (eq_int (zx, zy)))

and zneq_int ((zx, zy) : (Big_int.num * Big_int.num)) : bool = sail_call (fun r ->
  not (eq_int (zx, zy)))

and zneq_bool ((zx, zy) : (bool * bool)) : bool = sail_call (fun r ->
  not (eq_bool (zx, zy)))

type  zbits = (bit) list;;

let string_of_zbits (gs25 : zbits) = string_of_bits gs25;;

type 'za zoption = | ZNone of unit | ZSome of 'za;;

let string_of_zoption _ = "VARIANT";;

let rec zundefined_option : 'za. ('za) -> ('za) zoption = fun (ztyp_a) -> sail_call (fun r ->
  let zu_0 = (undefined_unit ()) in
  let zu_1 = ztyp_a in
  internal_pick [ZNone zu_0; ZSome zu_1])

and zhex_bits_1_forwards_matches (zbv : zbits) : bool = sail_call (fun r ->
  true)

and zhex_bits_1_backwards_matches (zs : string) : bool = sail_call (fun r ->
  begin
    match zs with
    | zs when (begin
      match (hex_bits_1_matches_prefix zs) with
      | ZSome (_, zn) when (eq_int (zn, (string_length zs))) -> true
      | _ -> false
    end) ->
      true
    | _ -> false
  end)

and zhex_bits_1_backwards (zs : string) : zbits = sail_call (fun r ->
  begin
    match (hex_bits_1_matches_prefix zs) with
    | ZSome (zbv, zn) when (eq_int (zn, (string_length zs))) -> zbv
  end)

